#import png
import pickle

def convert_image_to_script(fn_python, image, width=40):
    data = pickle.dumps(image)
    l = [data[i:i+40] for i in range(0, len(data), width)]
    l = str(l)[1:-1].split(', ')
    with open(fn_python, 'wt') as file:
        file.write('import pickle\n')
        file.write('\n')
        file.write('image = pickle.loads(\n')
        file.write(' +\n'.join(['    ' + o for o in l]))
        file.write('\n')
        file.write('    )\n')

